import{_ as e,o as t,c as n,O as i}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 24.2-648 Write-in votes on voting equipment.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-648.md","filePath":"vacode/24.2-648.md"}'),a={name:"vacode/24.2-648.md"},o=i('<h1 id="§-24-2-648-write-in-votes-on-voting-equipment" tabindex="-1">§ 24.2-648 Write-in votes on voting equipment. <a class="header-anchor" href="#§-24-2-648-write-in-votes-on-voting-equipment" aria-label="Permalink to &quot;§ 24.2-648 Write-in votes on voting equipment.&quot;">​</a></h1><p>Write-in votes may be cast on voting equipment for any person whose name does not appear on the ballot as a candidate for the office being voted, subject to this section and the provisions of § <a href="http://law.lis.virginia.gov/vacode/24.2-644/" target="_blank" rel="noreferrer">24.2-644</a> not in conflict with this section.</p><p>Each write-in vote shall be entered in the receptacle or area designated on the machine for the office being elected. A write-in vote shall be cast in its appropriate place, in accordance with the instructions for that equipment, or it shall be void and not counted.</p><p>Except on machines that provide a means to enter a name electronically, each write-in vote shall be entered by the voter in his own handwriting or hand printing.</p><p>Code 1950, § 24-307; 1962, c. 260; 1970, c. 462, § 24.1-217; 1975, c. 515; 1985, c. 458; 1990, c. 214; 1993, c. 641; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0005" target="_blank" rel="noreferrer">5</a>; 2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0540" target="_blank" rel="noreferrer">540</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0576" target="_blank" rel="noreferrer">576</a>.</p>',5),r=[o];function c(s,l,h,p,d,v){return t(),n("div",null,r)}const g=e(a,[["render",c]]);export{f as __pageData,g as default};
